import React from 'react'
import Navbar from './components/Navbar'
import { Router, Routes, Route } from "react-router-dom";
import Dashboard from './components/Dashboard';

const App = () => {
  return (
    <>
      <Router basename="">
        <Navbar />
        <Routes>
            <Route exact path="/dashboard" component={Dashboard} />
        </Routes>
      </Router>
    </>
  );
};

export default App;
